import React from 'react'
import { Card, CardHeader, CardBody, CardFooter } from 'react-simple-card';


function Box() {

  return (


    <Card>
        <ImageHeader imageSrc="http://via.placeholder.com/600x250" />
        <CardBody>Body</CardBody>
        <CardFooter>Footer</CardFooter>


        </Card>

    
 
    )
}

export default Box
